export class Ingredient {
    constructor(measurement) {
        Object.assign(this, measurement);
    }

    set volume(obj) {
        this.volume = obj;
    };

    set weight(obj) {
        this.weight = obj;
    };

    grams() {};
    milligrams() {};
    kilograms() {};

    milliliters() {};
    liters() {};

    ounces() {};
    pounds() {};

    cups() {};
    quarts() {};
    gallons() {};
    teaspoons() {};
    tablespoons() {};
    fluidOunces() {};
}
